import math

def isPrime(number):

    for i in range(2, int(math.sqrt(number)+1)):

        if number%i==0:

            return False

    return True

def FindPrimes2(Q):

    num = 2

    c = 0

    while c!=Q:

        if isPrime(num):

            c+=1

        num+=1

    return num-1

